 // Fondos base64 para cada hotel (debes agregar tus im√°genes reales en base64)
const fondos = {
  sheraton: "data:image/jpeg;base64,",

  marquis: "data:image/jpeg;base64," // <- aqu√≠ va la base64 de Marquis
 ,
  fontan: "data:image/jpeg;base64,",
 
  daikoku: "data:image/jpeg;base64,"

};

document.addEventListener("DOMContentLoaded", function () {
  const form = document.getElementById("invitationForm");

  form.addEventListener("submit", function (e) {
    e.preventDefault();

    // Verificar que jsPDF est√© cargado
    if (typeof window.jspdf === 'undefined') {
      alert("Error: La librer√≠a jsPDF no est√° cargada correctamente.");
      return;
    }

    const { jsPDF } = window.jspdf;

    const nombre = document.getElementById("nombre").value.trim();
    const estadoCivil = document.getElementById("estadoCivil").value;
    const personas = document.getElementById("mesaDescripcion").value;
    const hora = document.getElementById("horaCita").value;
    const fecha = document.getElementById("diaEvento").value;
    const celular = document.getElementById("celular").value;
    const codigo = document.getElementById("codigo").value;
    const hotelSeleccionado = document.getElementById("hotel").value;

    if (!hotelSeleccionado) {
      alert("Por favor selecciona un hotel.");
      return;
    }

    // Determinar el fondo correcto
    let fondoClave;
    if (hotelSeleccionado.toLowerCase().includes("sheraton")) {
      fondoClave = "sheraton";
    } else if (hotelSeleccionado.toLowerCase().includes("daikoku")) {
      fondoClave = "daikoku";
    } else if (hotelSeleccionado.toLowerCase().includes("marquis")) {
      fondoClave = "marquis";
    } else if (hotelSeleccionado.toLowerCase().includes("fontan")) {
      fondoClave = "fontan";
    } else {
      fondoClave = hotelSeleccionado.toLowerCase();
    }

    // Verificar que el fondo existe
    if (!fondos[fondoClave]) {
      alert(`Error: No se encontr√≥ el fondo para el hotel ${hotelSeleccionado}`);
      return;
    }

    const doc = new jsPDF();
    
    try {
      // Agregar imagen de fondo
      doc.addImage(fondos[fondoClave], "PNG", 0, 0, 210, 297);
    } catch (error) {
      alert("Error al cargar la imagen de fondo: " + error.message);
      return;
    }
    
    doc.setTextColor(255, 255, 255);

    const acompanantes = Array.from(document.getElementsByClassName("acompanante"))
      .map(input => input.value.trim())
      .filter(val => val !== "");

    let saludo = "";
    const estadosMasculinos = ["soltero", "casado", "uni√≥n libre", "divorciado", "viudo"];
    if (acompanantes.length > 0) {
      saludo = `ESTIMADOS: ${nombre.toUpperCase()} Y ${acompanantes.join(" Y ").toUpperCase()}`;
    } else {
      saludo = estadosMasculinos.includes(estadoCivil.toLowerCase())
        ? `ESTIMADO: ${nombre.toUpperCase()}`
        : `ESTIMADA: ${nombre.toUpperCase()}`;
    }

    doc.setFont("helvetica", "bold");
    doc.setFontSize(11);
    
    // Ajustar posici√≥n Y seg√∫n el hotel
    let saludoY;
    switch(fondoClave) {
      case "fontan":
        saludoY = 70;
        break;
      case "daikoku":
        saludoY = 75;
        break;
      case "sheraton":
        saludoY = 78;
        break;
      default:
        saludoY = 80;
    }
    
    doc.text(saludo, 105, saludoY, { align: "center" });

    doc.setDrawColor(255, 255, 255);
    doc.setLineWidth(0.5);
    doc.line(25, saludoY + 4, 160, saludoY + 4);

    doc.setFont("helvetica", "normal");

    // Ajustes de posici√≥n para Sheraton
    let x = fondoClave === "sheraton" ? 20 : 25;
    let textoMaxWidth = fondoClave === "sheraton" ? 130 : 160;
    const inicioY = saludoY + 12;

    const horaFormateada = convertirHoraAMPM(hora);

    doc.text(`Estado Civil: ${estadoCivil}`, x, inicioY);
    doc.text(`Mesa: ${personas.toUpperCase()}`, x, inicioY + 6);
    doc.text(`Hora de la cita: ${horaFormateada}`, x, inicioY + 12);
    doc.text(`D√≠a del evento: ${fecha}`, x, inicioY + 18);

    let y = inicioY + 30;
    
    // URLs de ubicaci√≥n actualizadas
    let ubicacionHotel = "#";
    switch(fondoClave) {
      case "marquis":
        ubicacionHotel = "https://maps.app.goo.gl/PoFQwAKxVKAfG4Cr7";
        break;
      case "fontan":
        ubicacionHotel = "https://maps.app.goo.gl/UVjAHobxNAHP5bwu9";
        break;
      case "sheraton":
        ubicacionHotel = "https://maps.app.goo.gl/LC3zgWA1BU9JGcwN9"; // Actualizar con URL real de Sheraton
        break;
      case "daikoku":
        ubicacionHotel = "https://maps.app.goo.gl/rh7fQWzjxPjd8ptHA";
        break;
    }

    doc.setFont("helvetica", "bold");
    doc.setFontSize(fondoClave === "sheraton" ? 10 : 11);
    const eventoTexto = "En este evento contaremos con:";
    const eventoWidth = doc.getTextWidth(eventoTexto);
    doc.text(eventoTexto, (doc.internal.pageSize.getWidth() - eventoWidth) / 2, y);
    y += 6;

    doc.setFont("helvetica", "normal");
    const items = [
      "Alimentos en cortes√≠a.",
      "Atenci√≥n personalizada para cada uno de nuestros invitados.",
      `Clave de acceso: ${codigo}`
    ];
    
    items.forEach(item => {
      doc.circle(x, y - 2, 1.5, "F");
      doc.text(item, x + 8, y);
      y += 6;
    });

    y += 7;
    doc.setFont("helvetica", "bold");
    const hotelNombre = hotelSeleccionado;
    doc.text(`El evento es patrocinado por Destination Connect Group en el ${hotelNombre}...`, x, y);
    y += 5;

    const textoDetalles = [
      `Ubicaci√≥n del Hotel: ${ubicacionHotel}`,
      "Recibir√°s un certificado de hospedaje vacacional v√°lido por 4 d√≠as y 3 noches...",
      "¬°Si no tienes fecha de viaje no te preocupes tienes medio a√±o de vigencia!"
    ];

    textoDetalles.forEach((t, index) => {
      const lines = doc.splitTextToSize(t, textoMaxWidth);
      if (index === 0) {
        doc.setTextColor(255, 255, 255);
        doc.text("Ubicaci√≥n del Hotel:", x, y);
        const labelWidth = doc.getTextWidth("Ubicaci√≥n del Hotel: ");
        doc.setTextColor(0, 102, 204);
        doc.textWithLink(ubicacionHotel, x + labelWidth + 1, y, { url: ubicacionHotel });
        doc.setTextColor(255, 255, 255);
        y += 7;
      } else {
        doc.text(lines, x, y);
        y += lines.length * (fondoClave === "sheraton" ? 5 : 7);
      }
    });

    y += 6;
    doc.setFont("helvetica", "bold");
    doc.setFontSize(fondoClave === "sheraton" ? 9 : 10);
    doc.text("Para acceder al evento y recoger su obsequio es indispensable:", x, y);
    y += 6;

    // Requisitos espec√≠ficos para cada hotel
    if (fondoClave === "marquis") {
      const requisitosCol1 = [
        "Mostrar cualquier identificaci√≥n vigente (INE y/o PASAPORTE).",
        "Identificarse con tarjeta vigente de cr√©dito y/o d√©bito vigente Visa, MasterCard o AMEX."
      ];
      const requisitosCol2 = [
        "Contar con el tiempo estimado de 90 minutos.",
        "Indispensable en caso de ser casado o vivir en uni√≥n libre nos acompa√±en en pareja."
      ];

      const col1X = x;
      const col2X = 110;
      const lineHeight = 12;

      doc.setFont("helvetica", "normal");
      doc.setFontSize(10);

      requisitosCol1.forEach((text, i) => {
        doc.circle(col1X, y + i * lineHeight - 1, 1.5, "F");
        doc.text(doc.splitTextToSize(text, 75), col1X + 8, y + i * lineHeight);
      });

      requisitosCol2.forEach((text, i) => {
        doc.circle(col2X, y + i * lineHeight - 1, 1.5, "F");
        doc.text(doc.splitTextToSize(text, 75), col2X + 8, y + i * lineHeight);
      });

      y += Math.max(requisitosCol1.length, requisitosCol2.length) * lineHeight + 5;
    } else {
      doc.setFont("helvetica", "normal");
      doc.setFontSize(fondoClave === "sheraton" ? 10 : 11);

      const requisitos = [
        ['Mostrar cualquier identificaci√≥n vigente', '(INE y/o PASAPORTE).'],
        ['Contar con el tiempo estimado de 90 minutos.', ''],
        ['Identificarse como tarjetahabiente cr√©dito y/o', 'd√©bito vigente Visa, MasterCard o AMEX.'],
        ['Indispensable en caso de ser casado o', 'vivir en uni√≥n libre', 'nos acompa√±en en pareja.']
      ];

      requisitos.forEach(text => {
        doc.circle(x, y - 1, 1.5, "F");
        const lines = doc.splitTextToSize(text, textoMaxWidth);
        doc.text(lines, x + 8, y);
        y += lines.length * (fondoClave === "sheraton" ? 5 : 7);
      });
    }

    // Descargar PDF
    try {
      const blob = doc.output('blob');
      const pdfUrl = URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = pdfUrl;
      a.download = `Invitacion_${nombre.replace(/\s+/g, "_")}.pdf`;
      a.click();

      // WhatsApp
      const mensaje = encodeURIComponent(`Hola ${nombre}, le hago llegar su invitaci√≥n para el evento del ${fecha} a las ${horaFormateada} en el ${hotelNombre}.`);
      const whatsappURL = `https://wa.me/52${celular}?text=${mensaje}`;
      window.open(whatsappURL, 'whatsappWindow', 'width=800,height=600');

      setTimeout(() => location.reload(), 1000);
    } catch (error) {
      alert("Error al generar el PDF: " + error.message);
    }
  });

  // Hora formato AM/PM
  function convertirHoraAMPM(hora24) {
    const [hora, minutos] = hora24.split(":");
    const h = parseInt(hora, 10);
    const ampm = h >= 12 ? "PM" : "AM";
    const hora12 = h % 12 || 12;
    return `${hora12}:${minutos} ${ampm}`;
  }

  // Agregar acompa√±antes
  document.getElementById("agregarAcompananteBtn").addEventListener("click", function () {
    const container = document.getElementById("acompanantesContainer");
    const input = document.createElement("input");
    input.type = "text";
    input.placeholder = "Nombre del Acompa√±ante";
    input.className = "acompanante";
    container.appendChild(input);
  });
});